import React from 'react';
import { Container, Grid, Papper } from '@material-ui/core';

const AuthPage = () => {

  return (
    <Container>
      <Grid container justify="center">
        <Grid item xs={12} md={4}>
          <Papper></Papper>
        </Grid>
      </Grid>
    </Container>
  );
};

AuthPage.getInitialProps = () => {
  return {};
};

export default AuthPage;
